package com.example.userschool.model;import java.io.Serializable;public class Student {    private int id;    private String name;    private String password;    private String phone;    private String className;    public Student(int id, String name, String password, String phone, String className) {        this.id = id;        this.name = name;        this.password = password;        this.phone = phone;        this.className = className;    }    public Student(int id, String name) {        this.id = id;        this.name = name;    }    public Student() {    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public String getPhone() {        return phone;    }    public void setPhone(String phone) {        this.phone = phone;    }    public String getClassName() {        return className;    }    public void setClassName(String className) {        this.className = className;    }}